Muchas felicidades a Entre Amigos
 por el premio Roque Nublo otorgado por 
@GranCanariaCab por su aportacion al folclore de Canarias. Pero esta asociacion es mucho mas. Es un ejemplo de como la cultura esta al servicio de los procesos de construccion de comunidad. ¡Enhorabuena! https://t.co/5ubyzCH9OT

Maria Buenadicha es nieta de un artista y oficial de correo fusilado en 1936 y el viernes ofrecera una mirada poetica sobre la #GuerraCivil espanola y las huellas que dejo en las siguientes generaciones. 
